import HeaderImgLogo from '../assets/img/Group.png';

const HeaderJs = [
  {
    navbar: [
      {
        HeaderImg: [
          {
            img: HeaderImgLogo,
          }
        ],
        navbarText: [
          { 
            text: 'Главная' 
          },
          {
             text: 'Про гида' 
            },
          { 
            text: 'Программа тура' 
          },
          {
             text: 'Стоимость'
             },
          { 
            text: 'Блог'
           },
        ],
        navbarButtonText: [
          { 
            buttonText: 'Консультация' },
        ],
      },
    ],
  },
];

export default HeaderJs
